const Navigation = () => {
  return (
    <>
      <h4>Navigation</h4>
      <div className="section">
        <nav>
          <button className="buttons">Home</button>
          <button className="buttons">Contact</button>
          <button className="buttons">About</button>
        </nav>
      </div>
    </>
  );
};

export default Navigation;
